@AdamZouhayr @ienmike @MelissaMbarki The #CovidVaccine was never sold as a 1-time life-time prevention. It was, &amp; still is, the best way to reduce the severity of the illness.

The ICUs show it works.

We still take annual flu shots for the pandemic of 100+ yrs ago. We're still in the early years of this one.

@docyogi1 @godbole_shilpa #CovidVaccine 
I heard a doctor say that if you have taken 2 doses of #Covishield then it is advisable to take 3rd booster dose of #Covaxin - and - vice versa.
Is there any scientific merit in this advice...?
